import React, { useEffect, useState } from "react";
import ReportForm from "./ReportForm";
import ReportList from "./ReportList";
import ReportView from "./ReportView";
import MapView from "./MapView";
import api from "../api/api";

export default function DashboardUser({ user }){
  const [reports, setReports] = useState([]);
  const [viewReport, setViewReport] = useState(null);

  useEffect(()=> {
    if(process.env.REACT_APP_API_BASE){
      api.getReports().then(setReports).catch(err=>{
        const raw = localStorage.getItem("seva_reports") || "[]";
        setReports(JSON.parse(raw));
      });
    } else {
      const raw = localStorage.getItem("seva_reports") || "[]";
      setReports(JSON.parse(raw));
    }
  }, []);

  function saveReports(arr){
    localStorage.setItem("seva_reports", JSON.stringify(arr));
    setReports(arr);
  }

  function handleNewReport(r){
    if(process.env.REACT_APP_API_BASE){
      api.createReport(r).then(saved=>{
        setReports(prev => [saved, ...prev]);
        alert("Report submitted");
      }).catch(err=>{
        console.warn("API create failed, saving locally", err);
        r.id = r.id || (Date.now()+"");
        const arr = [r, ...reports];
        saveReports(arr);
      });
      return;
    }
    r.id = r.id || (Date.now()+"");
    const arr = [r, ...reports];
    saveReports(arr);
    alert("Report submitted locally");
  }

  function handleView(r){ setViewReport(r); }
  function closeView(){ setViewReport(null); }
  function handleVote(id){
    if(process.env.REACT_APP_API_BASE){
      api.voteReport(id).then(updated=>{
        setReports(prev => prev.map(p=> p.id === id ? updated : p));
      }).catch(err=>{
        const arr = reports.map(r => r.id === id ? {...r, votes: (r.votes||0)+1 } : r);
        saveReports(arr);
      });
      return;
    }
    const arr = reports.map(r => r.id === id ? {...r, votes: (r.votes||0)+1 } : r);
    saveReports(arr);
  }
  function handleCompleteVote(id){
    if(process.env.REACT_APP_API_BASE){
      api.completeVoteReport(id).then(updated=>{
        setReports(prev => prev.map(p=> p.id === id ? updated : p));
      }).catch(err=>{
        const arr = reports.map(r => r.id === id ? {...r, completedVotes: (r.completedVotes||0)+1 } : r);
        saveReports(arr);
      });
      return;
    }
    const arr = reports.map(r => r.id === id ? {...r, completedVotes: (r.completedVotes||0)+1 } : r);
    saveReports(arr);
  }
  function handleComment(id, comment){
    if(process.env.REACT_APP_API_BASE){
      api.commentReport(id, comment).then(()=> {
        setReports(prev => prev.map(r => r.id === id ? {...r, comments: [...(r.comments||[]), comment]} : r));
      }).catch(()=>{
        const arr = reports.map(r => r.id === id ? {...r, comments: [...(r.comments||[]), comment]} : r);
        saveReports(arr);
      });
      return;
    }
    const arr = reports.map(r => r.id === id ? {...r, comments: [...(r.comments||[]), comment]} : r);
    saveReports(arr);
  }

  return (
    <div className="container">
      <h2>User Dashboard</h2>
      <div className="grid-2">
        <div>
          <ReportForm onSave={handleNewReport} />
          <ReportList reports={reports} onView={handleView} onVote={handleVote} onCompleteVote={handleCompleteVote} />
        </div>
        <div>
          <h3>Map â€” Live reports in Bettiah</h3>
          <MapView markers={reports.filter(r=>r.lat && r.lng).map(r=>({id:r.id, lat:parseFloat(r.lat), lng:parseFloat(r.lng), title:r.title, popup:r.area}))} height="600px" />
        </div>
      </div>

      {viewReport && <ReportView report={viewReport} onClose={closeView} onComment={handleComment} user={user} />}
    </div>
  );
}
